// contracts/Vesting.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/MathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";

contract Vesting is OwnableUpgradeable {
    using SafeMathUpgradeable for uint256;
    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.AddressSet;

    IERC20Upgradeable private token;
    EnumerableSetUpgradeable.AddressSet private beneficiaries;
    mapping(address => uint256) private vestingAmounts;
    mapping(address => uint256) private startTimes;
    mapping(address => uint256) private cliffDurations;
    mapping(address => uint256) private vestingDurations;
    mapping(address => uint256) private totalWithdrawn;
    mapping(address => uint256) public released;


    event VestingScheduled(address indexed beneficiary, uint256 amount, uint256 startTime, uint256 cliffDuration, uint256 vestingDuration);
    event TokensReleased(address indexed beneficiary, uint256 amount);

    function initialize(address _token) external initializer {
        __Ownable_init();
        token = IERC20Upgradeable(_token);
    }

    function scheduleVesting(
        address _beneficiary,
        uint256 _amount,
        uint256 _startTime,
        uint256 _cliffDuration,
        uint256 _vestingDuration,
        uint256 totalReceived
    ) external onlyOwner {
        require(_beneficiary != address(0), "Invalid beneficiary address");
        require(!beneficiaries.contains(_beneficiary), "Beneficiary already scheduled");
        require(_amount > 0, "Invalid vesting amount");
        require(_vestingDuration > 0, "Invalid vesting duration");

        beneficiaries.add(_beneficiary);
        vestingAmounts[_beneficiary] = _amount;
        startTimes[_beneficiary] = _startTime;
        cliffDurations[_beneficiary] = _cliffDuration;
        vestingDurations[_beneficiary] = _vestingDuration;

        emit VestingScheduled(_beneficiary, _amount, _startTime, _cliffDuration, _vestingDuration);
    }

  function releaseToken(address _beneficiary) external onlyOwner {
        require(beneficiaries.contains(_beneficiary), "Beneficiary not scheduled");

        // Add a check to ensure tokens haven't been released before
        require(!hasReleased(_beneficiary), "Tokens already released");

        uint256 unreleased = releasableAmount(_beneficiary);

        require(unreleased > 0, "No tokens to release");

        released[_beneficiary] = released[_beneficiary].add(unreleased);
        totalWithdrawn[_beneficiary] = totalWithdrawn[_beneficiary].add(unreleased);

        token.transfer(_beneficiary, unreleased);

        emit TokensReleased(_beneficiary, unreleased);
    }

    function releasableAmount(address _beneficiary) public view returns (uint256) {
        if (!beneficiaries.contains(_beneficiary)) {
            return 0;
        }

        uint256 cliff = startTimes[_beneficiary].add(cliffDurations[_beneficiary]);
        if (block.timestamp < cliff) {
            return 0;
        } else if (block.timestamp >= startTimes[_beneficiary].add(vestingDurations[_beneficiary])) {
            return vestingAmounts[_beneficiary].sub(released[_beneficiary]);
        } else {
            uint256 elapsed = block.timestamp.sub(startTimes[_beneficiary]);
            uint256 vestingDuration = vestingDurations[_beneficiary];
            uint256 vestedAmount = vestingAmounts[_beneficiary].mul(elapsed).div(vestingDuration);
            return vestedAmount.sub(released[_beneficiary]);
        }
    }

    function hasReleased(address _beneficiary) public view returns (bool) {
        return released[_beneficiary] > 0;
    }

    function getBeneficiaries() external view returns (address[] memory) {
        uint256 length = beneficiaries.length();
        address[] memory result = new address[](length);
        for (uint256 i = 0; i < length; i++) {
            result[i] = beneficiaries.at(i);
        }
        return result;
    }
}

